import React, { Component } from 'react'
import './NavBar.css'

class NavBar extends Component {
    // constructor(props) {
    //     super(props)

    //     this.state = {

    //     }
    // }

    render() {
        return (
            <nav className="navbar">
                <h1 className="navbar-heading">SheShare.com</h1>
                <div className="button-group">
                    <button className='b1' >Login</button>
                    <button className='b1'>Register</button>
                    <label class="button bars" for="check"><i class="fas fa-bars"></i></label>
                    <div class="side_bar">
                        <div class="title">
                            <div class="logo">CodingLab</div>
                            <label class=" button cancel" for="check"><i class="fas fa-times"></i></label>
                        </div>
                        <ul>
                            <li><i class="fas fa-qrcode"></i>Dashboard</li>
                            <li><i class="fas fa-link"></i>Shortcuts</li>
                            <li><i class="fas fa-stream"></i>Overview</li>
                            <li><i class="fas fa-calendar-week"></i>Events</li>
                        </ul>
                        
                    </div>
                </div>
            </nav>
        )
    }
}

export default NavBar
